import React from 'react';
import Thumbnail from 'react-webpage-thumbnail';

function Dashboard() {
    return (
        <div className = "dashboard-container">
            <h1>Dashboard</h1>
            <Thumbnail
  height={300}
  onLoad={function noRefCheck(){}}
  width={400}
/>
        </div>
    )
}

export default Dashboard;
